g2:c.PROCEDURE.g2:a.TEXT:
gensymcid-983-test(node: class benchmark-node)
status : truth-value; 
status-text : text; 
begin
status, status-text = call gensymcid-983-test-inner();
if status then
    call fail(node, status-text)
else
    call pass(node);
end

gensymcid-983-test-inner() = (truth-value, text)
text-visible : integer;
win1 : class g2-window;
begin
win1 = call rt-util-get-g2-server-window();
call rt-util-hide-each-kb-workspace-visible-on-window-and-wait(win1,2);
show the workspace of this procedure ;
call g2-lift-workspace-to-top (the workspace of this procedure, win1);
wait for 1 second; 
change the name of test-button to symbol("test-button-new");
wait for 1 second;
text-visible = call g2-text-visible-p("test-button-new");
post "text-visible = [text-visible]";
if text-visible>0 then
    return false, ""
else 
    return true, "test-button-new text is not visible";
end

rt-util-get-g2-server-window () = (class g2-window)
win1,win2 : class g2-window;
begin
win2 = call get-main-g2-window();
for win1 = each g2-window do
    if the g2-window-management-type of win1 exists and the g2-window-management-type of win1 is local and the g2-window-width of win1 /= 22 then 
        begin
            if not (win1 is the same object as win2) then 
                post "get-main-g2-window is a crap";
            return win1;
        end;
    end;
end

rt-util-hide-each-kb-workspace-visible-on-window-and-wait (win : class g2-window, delay : float)
ws : class kb-workspace;
visible : truth-value; 
begin
  for ws = each kb-workspace do
     visible = call g2-item-is-showing-in-window (ws,win);
     if visible then
       begin
       post "[the class of ws] is visible - hiding it";
       hide ws; 
       end;
  end;
wait for delay; 
end
